    def __init__(self):
        super().__init__(max_width=80)
    def _escape_rtf(self, text: str) -> str:
        """Escapes special characters for RTF."""
        text = text.replace("\\", "\\\\")
        text = text.replace("{", "\\{")
        text = text.replace("}", "\\}")
        return text

